        Let \\(A\\) be a square matrix. The matrix exponential of \\(A\\), \\(e^{A}\\),
        is a square matrix which can be defined either by means of the MacLaurin series
        \\(e^{A} = I + A + \\frac{1}{2}A^2 + \\cdots + \\frac{1}{k!} A^k + \\cdots\\).
        or as the value at \\( t=1 \\) of the matrix-valued function \\(e^{At}\\)
        such that for any vector \\(\\vec{x}_0\\) the solution to \\(\\frac{d}{dt}
        \\vec{x}(t) = A \\vec{x}(t) \\), with initial condition \\(\\vec{x}(0)=\\vec{x}_0\\)
        is given by \\(\\vec{x}(t) = e^{At}\\vec{x}_0\\). "},"displayName":{"formatTypeId":"format.text%3APlain%40okapia.net","languageTypeId":"639-2%3AENG%40iso.org","scriptTypeId":"15924%3ALATN%40iso.org","text":"Learn
